import React from "react";
import {
    HashRouter as Router, 
    Switch,
    Route,
    Link    
} from "react-router-dom";
import Homepage from "../Homepage/Homepage.js";
export default function Routing(){
    return(
        <Router>
            <>
                <Link to="/">Home</Link>
                <Link to="/about">About</Link>
                <Link to="/contact">Contact Me</Link>

                <Switch>
                    <Route exact path="/">
                        <Homepage/>
                    </Route>
                    <Route path="/about">
                        <Homepage/>
                    </Route>
                    <Route path="/contact">
                        <Homepage/>
                    </Route>
                    <Route path="/blog">
                        <Homepage/>
                    </Route>
                </Switch>
            </>
        </Router>
    );
}
